package main

import (
	"fmt"
)

func main() {
	// s := "a"
	// t := "aa"
	s := "abcd"
	t := "abcde"

	// s := ""
	// t := ""
	fmt.Println(findTheDifference(s, t))
}

func findTheDifference(s string, t string) byte {
	s1 := bytesMapping(s)
	t1 := bytesMapping(t)

	for c := range t1 {
		if s1[c] != t1[c] {
			return c
		}
	}

	return 0
}

func bytesMapping(n string) map[byte]int {
	by := make(map[byte]int)
	for i := 0; i < len(n); i++ {
		by[n[i]]++
	}

	return by
}
